void quicksort(char *r,int low,int high)

{

	int i,j;

	char temp;

	i=low;

	j=high;

	temp=r[i];

	while(i<j)

	{

		while(i<j&&r[j]>temp)

			j--;

		if(i<j)

		{

			r[i]=r[j];

			i++;

		}

		while(i<j&&r[i]<temp)

			i++;

		if(i<j)

		{

			r[j]=r[i];

			j--;

		}

			

		r[i]=temp;

		if(low<i) quicksort(r,low,i-1);

		if(i<high) quicksort(r,i+1,high);




	}

}
int max(int m,int n)
{
	return m<n?n:m;
}
